class List extends Component {
    constructor(){
        super();
        this.state = {
            data:[
                {
                    "id": "0001",
                    "price": 500,
                    "product": "Cake",
                    "quantity": 8
                },
                {
                    "id": "0002",
                    "price": 10,
                    "product": "Patise",
                    "quantity": 4
                },
                {
                    "id": "0003",
                    "price": 50,
                    "product": "Masala Dosa",
                    "quantity": 3
                }
            ]
        }
    }
  render() {
    return (
     <div >
       1233555
      </div>

    );
  }
}

export default List;
